import React, { Component } from 'react';
import './home.css'

export class Home extends Component {
  render() {
    return (
      <div className='home'>
        <h1>Login / Sign up</h1>
        <img src="https://marketplace.canva.com/MADGyYVoY2c/4/screen/canva-aerial-photography-of-cityscape-MADGyYVoY2c.jpg" alt="placeholder" />
      </div>
    )
  }
}

export default Home
